		if tbl == UserInputService then
			if idx == "TouchEnabled" then
				return true
			elseif idx == "MouseEnabled" then
				return false
			elseif idx == "KeyboardEnabled" then
				return false
			end
		end
		return index(tbl, idx)
	end)

end)

